import React from 'react'
import { Button } from 'react-native';

const Top = ({ navigation }) => {
  return (
    <Button
      title="Go to Dashboard"
      onPress={() =>
        navigation.navigate('Dashboard')
      }
    />
  )
}

const styles = StyleSheet.create({});

export default Top
